import desk from "./images/desk.png";

function App() {
  return (
    <div className="App">
      <div className="left-side">
        <h1>react rellax</h1>
        <p>This is a demo sentence</p>
        <p>This is also a slow demo sentence</p>
        <p>This is also a very very slow demo sentence</p>
        <button>Learn more</button>
      </div>
      <div className='right-side'>
        <img src={desk} />
      </div>
    </div>
  );
}

export default App;
